(11, 'Voices that Lead to Dangerous Disciplemaking', NULL, NULL, NULL, NULL, 'In the outdoor world, whether you’re mountain climbing or white-water rafting, you’d be wise to avoid joining teams with people who are in it for themselves. Though they may have strong talents and skills, they are not an asset to the team. People who go it alone, who aren’t interested in the team, get themselves or others hurt. Likewise, we need to be disciplemakers who are not in it for ourselves or who make it about us. There are voices in our lives that give us bad counsel and pull us away from the wise path. That’s why not knowing who we are or not accepting our limitations can create issues. We get distracted trying to be someone we are not, making it hard to hear Holy Spirit through the noise of our unaccepted soul. The more you know your own authentic, God-given voice, the better you can distinguish it from the voice of Holy Spirit, and from voices of treacherous imposters. They are counterfeits of the voice of God’s wisdom. These voices give you bad advice and lead you into danger.', 'https://newbreedtraining.com/wp-content/uploads/2023/05/dangerous-disciplemaking-blog.png', NULL, 'draft', 'Tech Blog', NULL, '2023-05-21 17:59:53', '2023-05-21 17:59:53');
